import React, { useEffect } from "react";
import { useState } from "react";


// https://pastebin.com/raw/xdLmcpTU
const Career = () => {

    const[jobOpening, seteJobOpening] = useState();
    useEffect(() => {
        fetch("https://pastebin.com/raw/xdLmcpTU")
        .then(res => res.json())
        .then(data => {
            seteJobOpening(data);
        })
    })

  return (
    console.log(...jobOpening)
  );
};

export default CareersTest;
